int main(void) {
  //初始化定时器 1/8
  TCCR1A = 0;
  TCCR1B = 1|_BV(WGM12);//0 1 0 clkI/O/8 (From prescaler)  //  1/8	2MHz 0.5us
  TCNT1 = 0;
  OCR1A = 2083;
  TIMSK1 |= _BV(OCIE1A);//TOIE1
  
  ADMUX = _BV(ADLAR)|0;
  ADCSRA = _BV(ADEN)|_BV(ADATE)|_BV(ADSC)|_BV(ADIE)|_BV(ADPS2)|_BV(ADPS1)|_BV(ADPS0);
  
  //打开输出端口
  DDRD |= _BV(7);

  DDRB = 0;
  PCICR |= _BV(PCIE0);
  PCICR |= _BV(PCIE2);
  PCMSK0 |= _BV(PCINT2);
  PCMSK2 |= _BV(PCINT18);
  PORTB |= _BV(7);//PD7 上拉
  
  sei();
  //主循环
  for(;;) 
  {
  }

}

volatile uint16_t totalidx = 0;
volatile uint8_t rowCount = 0;
volatile uint8_t colCount = 0;
uint8_t bitExt[] = {1,2,4,8,16,32,64,128};
volatile uint8_t value1 = 0;
//TIMER1_OVF_vect  TIMER1_COMPA_vect
ISR(TIMER1_COMPA_vect){
  PORTD &= ~_BV(7);
  PORTD |= value1;
  
  rowCount++;
  if(rowCount==8){
    rowCount = 0;
    colCount++;
    if(colCount==32)
    {
      value1 = 0;
    }
  }
  
  uint8_t v = pgm_read_byte_near(data+totalidx+colCount);
  v = v & bitExt[rowCount];
  if(v){
    value1 = _BV(7);
  }
  else
  {
    value1 = 0;
  }
}

volatile uint8_t rpmCount = 0;
//时钟输入
ISR(PCINT0_vect){
  rpmCount++;
  if(rpmCount==36){
    rpmCount = 0;
    rowCount = 0;
    colCount = 0;

    totalidx+=32;
    if(totalidx>=32*800)
    {
      totalidx=0;
    }
    
  }
}

//按钮输入
ISR(PCINT2_vect){
  if(PIND & _BV(2)){
    totalidx = 0;
  }
}

uint8_t adcOldval = 0;
ISR(ADC_vect){
  uint8_t tmp = ADCH>>2;
  if(tmp>adcOldval){
    rpmCount--;
  }
  if(tmp<adcOldval){
    rpmCount++;
  }
  adcOldval = tmp;
}
  